import React from "react";
import "./cartIconscss";

import { ReactComponent as Icon } from "../../assets/shopping-bag.svg";

const CartIcon = () => {
  return (
    <div className="cart-icon">
      <Icon className="icon" />
      <div className="item-count">3</div>
    </div>
  );
};

export default CartIcon;
